import './Card.css';

function Card({ data }) {
  return (
    <div className="card">
      <div>
        <img
          src={data.imageUrl}
          alt={data.name}
          className="card-image"
        />
      </div>
      <div className="card-content">
        <h2 className="card-title">{data.name}</h2>
        <p className="card-description">{data.description}</p>
        <p className="card-price">{data.price}</p>
      </div>
    </div>
  );
}

export default Card;
